import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';


class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      }, {
        id: 2,
        title: 'Dinner with gf',
        completed: true
      }, {
        id: 3,
        title: 'Submit the application',
        completed: false
      }, {
        id: 4,
        title: 'Meeting with boss',
        completed: false
      }
    ]
  }

  render() {
    // console.log(this.state.todos.map((todo) => console.log(todo.title)));
    return (
      <div className="App">
        <Todos />
        <div className="todos">
          <h3>{this.state.todos}</h3>
        </div>
      </div>
    );
  }
}

